    true,nt"url": null,nt"notes": "<p>The Medicare Provider Analysis and Review
    (MEDPAR) File contains data from claims for services provided to beneficiaries admitted
    to Medicare certified inpatient hospitals and skilled nursing facilities (SNF).
    The accumulation of claims from a beneficiarys date of admission to an inpatient
    hospital, where the beneficiary has been discharged, or to a skilled nursing facility,
    where the beneficiary may still be a patient, represents one stay. A stay record
    may represent one claim or multiple claims.</p>n",nt"license_title": "Other
